import React from 'react';
import { Link } from 'react-router-dom';

export default function CreateHotelList(props) {
  return (
    <div>
      {props.hotels && props.hotels.map(hotel => (
        <div key={hotel.id}>
          <Link to={`/hotels/${hotel.id}`}><h3>{hotel.hotel_name}</h3></Link>
        </div>
      ))}
      <Link to="/hotels/new"><button>Add a hotel</button></Link>
    </div>
  )
}
